import Layout from '../../components/layout';

import Button from '@material-ui/core/Button';

const CreatePost = () => {
    return (
        <Layout home={false}>
            <Button variant="contained" color="primary" disableElevation>
                Disable elevation
            </Button>

            <div>CreatePost</div>
        </Layout>
    );
};

export default CreatePost;
